import React from "react";
import PrimaryButton from "../components/Button";

function ContactPage() {
  const handleLinkClick = () => {
    console.log("Send message")
  };

  return (
    <>
      <div className="w-full max-w-screen-xl mx-auto p-4 md:py-10">
        {/* Page Title */}
        <div className="text-white p-4 pl-20 text-xl flex justify-center">
          Contact Me
        </div>

        {/* Content */}
        <div className="flex">
          {/* Input form */}
          <div className="text-white border border-yellow-500">

            <div className="m-6">
              {/* Name */}
            <div className="border mt-4 ">
              Name
            </div>
            {/* Email */}
            <div className="border mt-4 ">
              Email
            </div>
            {/* Description */}
            <div className="border mt-4 ">
              Description
            </div>
            {/* Button to send */}
            <div className="mt-4">
            <PrimaryButton
              text="SEND"
              onClick={handleLinkClick}
              backgroundColor="#FFFF00"
              width="200px"
            />
          </div>
            </div>
          </div>

          {/* Get in Touch */}
          <div className="text-white ml-8">Get in Touch</div>
        </div>
      </div>
    </>
  );
}
export default ContactPage;
